import './Nav.css'
const Nav = () => {
    return (
      <div>
        <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#news">News</a></li>
            <li><a href="#contact">Contact</a></li>
            <li style="float:right"><a class="active" href="#about">About</a></li>
        </ul>
      </div>
    );
  }
  
  export default Nav;
